/** @format */

import React from "react";

const Input = ({ setAddress}) => {
	const func = place => {
		console.log(place);
		if (place === 0){
			console.log("World");
			setAddress(
				`https://www.openstreetmap.org/export/embed.html?bbox=-180.35156250000003%2C-52.908902047770255%2C211.99218750000003%2C82.02137801950887&amp;layer=cyclemap`
			);}
		else if (place === 1){
			console.log("India");
			setAddress(
				`https://www.openstreetmap.org/export/embed.html?bbox=65.96191406250001%2C8.754794702435618%2C99.62402343750001%2C33.578014746144014&amp;layer=cyclemap`
			);}
		else if (place === 2){
			console.log("World");
			setAddress(
				`https://www.openstreetmap.org/export/embed.html?bbox=-12.458496093750002%2C49.97948776108648%2C4.372558593750001%2C57.868131763328826&amp;layer=cyclemap`
			);}
		else{
			console.log("World");
			setAddress(
				`https://www.openstreetmap.org/export/embed.html?bbox=-183.515625%2C6.664607562172573%2C-48.86718750000001%2C74.4964131169431&amp;layer=cyclemap`
			);}
		
	};
	return (
		<>
			<button
				style={{
					height: "30px",
					width: "100px",
					zIndex: "311119111",
					position: "absolute",
					top: "5vh",
					left: "50vw",
					borderRadius: "8px",
					outline: "none",
				}}>
				Load
			</button>
			<select
				id='voice-select'
				name='place'
				style={{
					height: "30px",
					width: "100px",
					zIndex: "31111111",
					position: "absolute",
					top: "15vh",
					left: "50vw",
					borderRadius: "8px",
					outline: "none",
					defaultValue: "World",
				}}
				onChange={(e)=>{func(e.target.value)}}
				className='form-control form-control-lg'>
				<option value='1'>India</option>
				<option value='2' >
					UK
				</option>
				<option value='3' >
					USA
				</option>
				<option value='0' >
					World
				</option>
			</select>
		</>
	);
};

export default Input;
